import { ReactNode } from "react";
import { Card, CardContent, CardDescription, CardHeader, CardTitle } from "./ui/card";

interface FeatureCardProps {
  icon: ReactNode;
  title: string;
  description: string;
}

const FeatureCard = ({ icon, title, description }: FeatureCardProps) => {
  return (
    <Card className="border-none bg-white/80 backdrop-blur-sm hover:shadow-xl transition-all duration-300 overflow-hidden rounded-xl">
      <CardHeader className="pb-2 flex flex-col items-center text-center">
        <div className="w-16 h-16 rounded-full bg-gradient-to-br from-primary-50 to-primary-100 flex items-center justify-center text-primary-600 mb-4 shadow-sm animate-float">
          {icon}
        </div>
        <CardTitle className="text-xl font-semibold text-slate-800">{title}</CardTitle>
      </CardHeader>
      <CardContent className="text-center">
        <CardDescription className="text-slate-600 text-base leading-relaxed">{description}</CardDescription>
      </CardContent>
    </Card>
  );
};

export default FeatureCard;
